class Tile extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            name: 'bulbasaur',
            id: 1,
            type: ['grass', 'poison']
        }

        this.printType = this.printType.bind(this);
    }

    render() {
        return (
            <h1>Pokemon {this.state.name} with ID: {this.state.id}</h1>



        );
    }

    printType() {
        types = this.state.types.map((type) =>
